import React, {Component} from 'react';
import AircraftServices from "../../services/AircraftServices";
import Aircraft from "../reusableComponents/Aircraft";

class UpdateAircraftComponent2 extends Component {
    constructor(props) {
        super(props);
        this.state = {
            id: this.props.match.params.id
        }
    }



    updateAircraft = (event) => {
        event.preventDefault();

        let aircraft = {
            aircraftType: this.state.aircraftType,
            engineNumber: this.state.engineNumbers,
            seatsNumber: this.state.seatsAmount,
            workingHour: this.state.workingHours,
            maxSpeed: this.state.maxSpeed,
        }
        console.log("aircraft => " + JSON.stringify(aircraft));

        AircraftServices.updateAircraft(aircraft, this.state.id).then((result => {
            console.log(result.data)
            this.props.history.push('/flight/aircraft')
        }))

    }

    cancel = (event)=>{
        event.preventDefault();

        this.props.history.push('/flight/aircraft')
    }

    render() {
        return (
            <div>
                <Aircraft id={this.state.id}
                          onComponentMount={this.componentDidMount}
                          updateItem={this.updateAircraft}
                          button='Update'
                          title='Update Aircraft'

                />
            </div>
        );
    }
}

export default UpdateAircraftComponent2;
